DROP VIEW IF EXISTS `psychology`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `psychology` AS select `a`.`stuId` AS `stuId`,`a`.`queAns` AS `queAns`,`a`.`queCode` AS `queCode`,`a`.`queSeq` AS `queSeq`,`b`.`option_number` AS `option_number`,`q`.`reverse_scoring` AS `reverse_scoring`,`q`.`part` AS `part` from ((`answer` `a` join `test_table` `b` on(((`a`.`queCode` = `b`.`question_code`) and (`a`.`paperCode` = `b`.`EC_code`)))) join `question_bank` `q` on((`a`.`queCode` = `q`.`question_code`))) where (`b`.`option_number` = 7) ;
